package com.CS3560Project;

import com.CS3560Project.utility.Constants;
import com.CS3560Project.utility.Utils;
import javafx.application.Application;
import javafx.scene.Group;
import javafx.scene.Scene;
import javafx.scene.image.ImageView;
import javafx.stage.Stage;

public class ImageTesting extends Application {

    //TODO EXTREMELY TEMP, Remove later
    String base64 = "";
    @Override
    public void start(Stage stage) throws Exception {
        // Display the image inside an ImageView
        ImageView iv = new ImageView(Utils.bufferedImageToFXImage(Utils.base64ToBufferedImage(base64)));

        iv.setX(10);
        iv.setY(10);
        iv.setFitWidth(800);
        iv.setFitHeight(600);
        iv.setPreserveRatio(true);

        Group root = new Group(iv);
        Scene scene = new Scene(root, 1000, 800);

        stage.setTitle(Constants.APPLICATION_TITLE);
        stage.setScene(scene);
        stage.show();
    }
}
